import React from "react";
import WelcomeBox from "./WelcomeBox";
import Slider1 from '../components/images/slider5.jpg'

function Welcome() {
    return(
 <div id="welcomes">
     <div className="a-container">
             <WelcomeBox image={Slider1} title="Welcome to Our Website" />
     </div>
 </div>
    );
}

export default Welcome;
